import React from "react";
import "./cart-item.styles.scss";

const CartItem = ({ item: { imageUrl, name, price, quantity } }) => (
  <div className="cart-item">
    <div>
      {name}
      <span>
        {quantity} x {price}
      </span>
    </div>
  </div>
);

export default CartItem;
